b'Accountants belastingadvieskantoor voor bedrijven ZZP-ers en particulieren met meer dan 25 jaar ervaring.Belastingadvies
en accountancy is een vak. Dat vak beheersen wij. Wij werken creatief
deskundig degelijk en doelgericht. Wij bedenken voor u oplossingen waarmee u
verder kunt. Dat is ons ambacht dat is onze ambitie.Wij verzorgen o.a.:-&nbsp;
Belastingadvies en belastingaangiften(voor MKB ZZP
particulier);

- &nbsp;Samenstellen van jaarrekeningen;

-&nbsp;
Inrichten van de bedrijfs- of
projectadministratie;

-&nbsp;
Opstellen van budgetten en financi\xc3\xable prognoses;

-&nbsp;
Analyse en (tussentijdse) rapportage&nbsp; van lopende projecten;

-&nbsp;
Financi\xc3\xable planning voor bedrijf of vermogende
particulier;

-&nbsp;
Begeleiding van startende ondernemers;

-&nbsp;
Verzorgen van de financi\xc3\xable administratie (op
locatie of o.a. met Exact Online);

-&nbsp;
Verzorgen van de loonadministratie;

-&nbsp;
Second opinion over fiscale en administratieve
zaken.
'

b'030 Accountant helpt en adviseert u met al uw financi\xc3\xable zaken. 

Onze voordelen op een rij: 
 
 \xe2\x96\xa0E\xc3\xa9n vast aanspreekpunt;
 \xe2\x96\xa0Op dezelfde dag antwoord op uw vragen;
 \xe2\x96\xa0Kwaliteit tegen een heldere prijs;
 \xe2\x96\xa0Maand- of kwartaalabonnement mogelijk;
 \xe2\x96\xa0Een netwerk van diverse specialisten.

Onze specialisatie: 

 \xe2\x96\xa0Businesscoach voor de MKB-ondernemer en de ZZP-er voor al zijn financi\xc3\xable zaken;
 \xe2\x96\xa0Samen met Kamphuis Financi\xc3\xable diensten onder \xc3\xa9\xc3\xa9n dak (www.kamphuisfd.nl) ook 
 verzekeringen hypotheken en pensioenen;
 \xe2\x96\xa0Medisch specialisten;
 \xe2\x96\xa0Fusie en Overname (Horeca);
 \xe2\x96\xa0Vrijwillige controles stichtingen en verenigingen (Goede Doelen);
 \xe2\x96\xa0Financi\xc3\xable planning;
 \xe2\x96\xa0Testamentenscan.
 
030 Accountant zorgt dat u zich kunt bezighouden met de dingen waar u 
goed in bent. Wij werken met vaste abonnementen (maand/kwartaal) die 
vooraf aan de hand van uw specifieke wensen samengesteld worden. 
Hierdoor behoudt u prijszekerheid. Hierdoor bieden wij kwaliteit tegen 
een heldere prijs.
 
Als klein flexibel kantoor zijn wij de ideale partner voor het MKB van
 eenmanszaak tot BV en van starter tot ervaren ondernemer. De 
communicatielijnen zijn kort dit betekent een vast aanspreekpunt goede
 bereikbaarheid en snelle service. 030 Accountant vindt het belangrijk 
dat u een goed gevoel heeft over onze dienstverlening. Dit vertrouwen is
 de basis voor een goede samenwerking.
 
030 Accountant werkt samen met diverse specialisten. Echter we 
schakelen pas een specialist in wanneer dit echt nodig is. Dit gebeurt 
altijd in overleg. Kortom: u betaalt niet voor specialisten die u niet 
nodig heeft.'

b'CijferMeester Haren is een professioneel jong en
dynamisch administratiekantoor met o.a. meer dan 25 jaar ervaring in de retail &nbsp;met oog voor persoonlijke aandacht en kwaliteit. Met de kennis en deskundigheid
van een groot kantoor maar met de charme en lage kosten van een kleiner
kantoor dat zich met veel enthousiasme richt op de financi\xc3\xable dienstverlening
en advies voor ondernemers (dus ook zzp'ers) in de regio Groningen en
Noord-Drenthe. Wij willen u graag ontzorgen zodat u kunt doen waar u goed in
bent nl. "ondernemen"!

Wij leveren maatwerk en luisteren naar uw wensen op
het gebied van:

- het voeren van uw boekhouding en
salarisadministratie;&nbsp;
- controle van een door u zelf gevoerde administratie b.v. in ons&nbsp;&nbsp; online (cloud) boekhoudpakket "Twinfield";&nbsp;
- verrichten van de aangiften BTW etc;&nbsp;
- 24/7 overzichten van de belangrijkste cijfers van uw&nbsp;&nbsp; onderneming m.b.v. "Visionplanner" of "Speedbooks";&nbsp;
- opstellen van uw jaarrekening;&nbsp;
- verrichten van uw aangifte IB / VPB;&nbsp;
- begeleiding bij de start van uw onderneming;&nbsp;
- administratief en fiscaal (proactief) advies;&nbsp;
- altijd en overal inzage in het digitale facturenarchief.

Onze prijzen zijn scherp en transparant omdat wij
werken met vaste tarieven op basis van all-in maandabonnementen zodat u qua uitgaven
nooit voor verrassingen komt te staan. Neem bv. het ZPP-tarief v.a. \xe2\x82\xac 95- p/mnd. In deze all-in maandabonnementen is ook het
(proactief) advies inbegrepen.
CijferMeester Haren is aangesloten bij de landelijke "CijferMeester"
organisatie van zelfstandige administratiekantoren. Omdat we vrijwel volledig
digitaal en met de modernste en meest effici\xc3\xabnte software werken zijn uw kosten
daarom lager.&nbsp;
Daarnaast beschikken wij over het Cijfermeester-netwerk van hooggekwalificeerde
specialisten op fiscaal financieel en bedrijfseconomisch gebied. En deze
professionals-op-afroep betaalt u alleen als u hun kennis nodig heeft.&nbsp;
CijferMeester Haren; meer dan alleen cijfers!


'
